    def find_max_edges(edges, n):
        parent = [-1] * (n + 1)
        rank = [0] * (n + 1)

        def make_set(v):
            parent[v] = v
            rank[v] = 0

        def find_set(v):
            if parent[v] != v:
                parent[v] = find_set(parent[v])
            return parent[v]

        def union(u, v):
            u_root = find_set(u)
            v_root = find_set(v)
            if u_root == v_root:
                return
            if rank[u_root] < rank[v_root]:
                parent[u_root] = v_root
            elif rank[u_root] > rank[v_root]:
                parent[v_root] = u_root
            else:
                parent[v_root] = u_root
                rank[u_root] += 1

        for a, b in edges:
            make_set(a)
            make_set(b)
            union(a, b)

        max_edges = 0
        for i in range(1, n + 1):
            max_edges += len(set(find_set(i) for i in edges[i - 1] if find_set(i) != find_set(i + 1)))

        return max_edges

