                        queue.append((edge[0], degree + 1))
                    else:
                        queue.append((vertex, degree + 1))
                        queue.append((edge[0], degree + 1))
                        queue.append((edge[1], degree + 1))

    # If there is no spanning tree, return NO
    if not spanning_tree:
        return "NO\n"

