    def get_bf_code(expression: str) -> str:
        code = ""
        stack = []
        for token in expression.split():
            if token.isdigit():
                stack.append(chr(int(token)))
            else:
                a, b = stack.pop(), stack.pop()
                if token == "+":
                    code += "+" * (ord(a) + ord(b)) + "<" * (ord(a) + ord(b) + 1)
                elif token == "-":
                    code += "-" * (abs(ord(a) - ord(b))) + "<" * (abs(ord(a) - ord(b)) + 1)
        return code

    expression = stdin.strip()
    if expression.count("-") % 2 != 0:
        return "Expression must contain an even number of minus signs."
    bf_code = get_bf_code(expression)
    if len(bf_code) > 5000000:
        return "Program length exceeds 5000000 characters."
    return bf_code

