        return "NO"

    # check if the permutation is already sorted
    if p == list(range(1, N+1)):
        return "YES"

    # find the first two elements that are out of order
    for i in range(N-1):
        if p[i] > p[i+1]:
            break

    # if there are no such elements, the permutation is already sorted
    if i == N-1:
        return "YES"

    # otherwise, check if swapping p[i] and p[i+1] will sort the permutation
    p[i], p[i+1] = p[i+1], p[i]
    if p == list(range(1, N+1)):
        return "YES"
    else:
        p[i], p[i+1] = p[i+1], p[i]
        return "NO"

