        adj_list[b-1].append(a-1)

    # Use recursive backtracking to find the paths
    visited = [False] * N
    result = 0

    def backtrack(node):
        nonlocal result
        visited[node] = True
        for neighbor in adj_list[node]:
            if not visited[neighbor]:
