    A, B, K = map(int, stdin.split())

    # Find the divisors of A and B
    divisors_A = set()
    divisors_B = set()
    for i in range(1, int(A**0.5)+1):
        if A % i == 0:
            divisors_A.add(i)
            if i != A // i:
                divisors_A.add(A // i)
    for i in range(1, int(B**0.5)+1):
        if B % i == 0:
            divisors_B.add(i)
            if i != B // i:
                divisors_B.add(B // i)

    # Find the K-th largest common divisor
    common_divisors = divisors_A.intersection(divisors_B)
    common_divisors = sorted(list(common_divisors), reverse=True)
    kth_largest = common_divisors[K-1]

    return str(kth_largest)

