    def compute_initial_mst_cost(n: int, m: int, edges: list) -> int:
        from collections import defaultdict
        graph = defaultdict(list)
        for u, v, w in edges:
            graph[u].append((v, w))
            graph[v].append((u, w))
        min_heap = [(0, 1)]
        visited = set()
        total_cost = 0
        while min_heap:
            cost, node = heapq.heappop(min_heap)
            if node in visited:
                continue
            visited.add(node)
            total_cost += cost
            for neighbor, neighbor_cost in graph[node]:
                if neighbor not in visited:
                    heapq.heappush(min_heap, (neighbor_cost, neighbor))
        return total_cost

    def find_mst_with_cost(n: int, m: int, edges: list, k: int) -> int:
        from collections import defaultdict
        graph = defaultdict(list)
        for u, v, w in edges:
            graph[u].append((v, w))
            graph[v].append((u, w))
        min_heap = [(0, 1)]
        visited = set()
        total_cost = 0
        while min_heap:
            cost, node = heapq.heappop(min_heap)
            if node in visited:
                continue
            visited.add(node)
            total_cost += cost
            for neighbor, neighbor_cost in graph[node]:
                if neighbor not in visited:
                    heapq.heappush(min_heap, (neighbor_cost, neighbor))
            if total_cost == k:
                return 0
            if total_cost > k:
                return -1
        return -1

    def unify_mst(n: int, m: int, edges: list, k: int, operations: int) -> int:
        if operations == 0:
            return 0
        initial_cost = compute_initial_mst_cost(n, m, edges)
        if initial_cost == k:
            return 0
        if initial_cost > k:
            return -1
        best_operations = -1
        for i in range(n):
            for j in range(n):
                if i == j or i < j:
                    continue
                new_edges = edges + [(i, j, 1)]
                new_cost = find_mst_with_cost(n, m + 1, new_edges, k)
                if new_cost != -1:
                    best_operations = max(best_operations, new_cost + 1)
        return best_operations

