        a[i] += 1
        if a[i] == m:
            a[i] = 0

    def generate_valid_array(a, m, n):
        result = a.copy()
        c_r = calculate_c_r(result)
        while not all(c % m == 0 for c in c_r):
            min_c = min(c for c in c_r if c % m != 0)
            min_i = c_r.index(min_c)
            move(result, min_i)
            c_r = calculate_c_r(result)
        return result

