    # Compute the unlikeliness matrix
    unlikeliness = [[0] * n for _ in range(n)]
    for i in range(n):
        unlikeliness[i][i] = diff_matrix[i][i]
    for k in range(1, n):
        for i in range(n - k):
            j = i + k
            unlikeliness[i][j] = min(unlikeliness[i][m] + unlikeliness[m+1][j] + diff_matrix[i][j] for m in range(i, j))

    # Compute the minimal unlikeliness
    minimal_unlikeliness = min(unlikeliness[i][j] for i in range(n-1) for j in range(i+1, n))

    # Print the minimal unlikeliness and the edges of the tree
    output = [str(minimal_unlikeliness)]
