        elif direction == 'D':
            return x + 1, y
        elif direction == 'L':
            return x, y - 1
        elif direction == 'R':
            return x, y + 1
        else:
            return None

    def bfs(start_x, start_y):
        visited = set()
        queue = [(start_x, start_y, 0)]
        while queue:
            x, y, steps = queue.pop(0)
            visited.add((x, y))
            if grid[x][y] == '0':
                return steps
            for direction in 'UDLR':
                neighbor_x, neighbor_y = get_neighbors(x, y, direction)
                if neighbor_x is not None and neighbor_y is not None:
                    if (neighbor_x, neighbor_y) not in visited:
                        queue.append((neighbor_x, neighbor_y, steps + 1))
        return -1

    def is_escapable():
        start_x, start_y = None, None
        for x in range(N):
            for y in range(M):
                if grid[x][y] == 'S':
                    start_x, start_y = x, y
                    break
            if start_x is not None:
                break
        if start_x is None:
            return False

        for x in range(N):
            for y in range(M):
                if grid[x][y] == '1':
                    if x == start_x or y == start_y:
                        return True
                elif grid[x][y] in 'UDLR':
                    neighbor_x, neighbor_y = get_neighbors(x, y, grid[x][y])
                    if neighbor_x == start_x or neighbor_y == start_y:
                        return True
        return False

    if is_escapable():
