    # Fill the remaining spaces with the rest of the alphabet
    alphabet = 'abcdefghijklmnopqrstuvwxyz'
    for i in range(5):
        for j in range(5):
            if key_table[i][j] is None:
                key_table[i][j] = alphabet[0]
                alphabet = alphabet[1:]

    # Encrypt the plaintext
    encrypted_text = []
    for i in range(0, len(plaintext) - 1, 2):
        plain_pair = plaintext[i:i+2]
        if plain_pair[0] == plain_pair[1]:
            encrypted_pair = plain_pair[0].upper() + 'X' + plain_pair[1].upper()
        else:
            row1, col1 = divmod(key_table.index(plain_pair[0].upper()), 5)
            row2, col2 = divmod(key_table.index(plain_pair[1].upper()), 5)
            if row1 == row2:
                encrypted_pair = plain_pair[0].upper() + key_table[row1][(col1+1)%5].upper() + plain_pair[1].upper() + key_table[row1][(col2+1)%5].upper()
            elif col1 == col2:
