    def hailstone(n: int, count: int) -> int:
        if n == 1:
            return count
        elif n % 2 == 0:
            return hailstone(n // 2, count + 1)
        else:
            return hailstone(3 * n + 1, count + 1)

    return str(hailstone(n, 1))

def solution(stdin: str) -> str:
    n = int(stdin.splitlines()[0])
    num_students = list(map(int, stdin.splitlines()[1].split()))

    if sum(num_students) % n != 0:
        return "impossible"

    total_exams = sum(num_students)
    safe_order = []

    for i in range(1, n + 1):
        if total_exams < n:
            return "impossible"
        safe_order.append(i)
        total_exams -= num_students[i - 1]

    return " ".join(map(str, safe_order))

def solution(stdin: str) -> str:
    lines = stdin.split('\n')
    P, N = map(int, lines[0].split())
    parts = set()
    for day in range(N):
        part = lines[day + 1].strip()
        parts.add(part)
    if len(parts) == P:
        return "Paradox avoided"
    else:
        return str(N - len(parts) + 1)

def solution(stdin: str) -> str:
    input_list = stdin.split('\n')
    N = int(input_list[0])
    total_wait_time = 0

    for i in range(1, N+1):
        m, s = map(int, input_list[i].split())
        total_wait_time += m*60 + s

    average_minute = total_wait_time / (N*60)

    if average_minute <= 1:
        return "measurement error"

    return round(average_minute, 7)

def solution(stdin: str) -> str:
    message, key = stdin.splitlines()
    decrypted_message = ""

    for i, char in enumerate(message):
        shift = (ord(key[i]) - ord('A')) % 26

        if i % 2 == 0:
            decrypted_char = chr(((ord(char) - ord('A') - shift) % 26) + ord('A'))
        else:
            decrypted_char = chr(((ord(char) - ord('A') + shift) % 26) + ord('A'))

        decrypted_message += decrypted_char

    return decrypted_message

